const parse = require('./proto-parse.js');

test('test package', ()=>{
	let data = parse(`
	syntax = "proto3";

	message SearchRequest {
		string query = 1;
		int32 page_number = 2;
		int32 result_per_page = 3;
		message Exmpl{
			oneof test_oneof {
				string name = 4;
				SubMessage sub_message = 9;
			}
		}
		enum Corpus {
		  UNIVERSAL = 0;
		  WEB = 1;
		  IMAGES = 2;
		  LOCAL = 3;
		  NEWS = 4;
		  PRODUCTS = 5;
		  VIDEO = 6;
		}
		Corpus corpus = 4;
		map<int32, string> bla = 1;
		repeated Exmpl results = 1;
		reserved 2, 15, 9 to 11;
	  }
	`);
	console.log(JSON.stringify(data))
})